import React, { useState, useEffect } from 'react';
import Axios from 'axios';


const Dashboard = (props) => {

    // state = {
    //     // Code goes here
    // }

    const getProduce = () => {
        Axios.get('/api/pieChart/produce')
    };

    const getBread = () => {
        Axios.get('/api/pieChart/bread')
    };

    const getDairy = () => {
        Axios.get('/api/pieChart/dairy')
    };

    const getMeat = () => {
        Axios.get('/api/pieChart/meat')
    };

    const getSpices = () => {
        Axios.get('/api/pieChart/spices')
    };

    const getNonParish = () => {
        Axios.get('/api/pieChart/nonParish')
    };


    const pieChartAjax = (arg) => {
        Axios.all([getProduce(), getBread(), getDairy(), getMeat(), getSpices(), getNonParish()]).then(axios.spread((produce, bread, dairy, meat, spices, parish) => {
            console.log(produce, bread, dairy, meat, spices, parish)
        }))
    };


   const style = {
        graphs: {
            display: 'flex',
            justifyContent: 'space-around'
        },
        leftGraph: {
            width: '30vw',
            height: '50vh',
            backgroundColor: 'red',
            margin: '30px auto',
            color: 'whitesmoke',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            fontSize: '30px',
            fontWeight: 'bold'
        },
        rightGraph: {
            width: '30vw',
            height: '50vh',
            backgroundColor: 'blue',
            margin: '30px auto',
            color: 'whitesmoke',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            fontSize: '30px',
            fontWeight: 'bold'
        },
        infoDiv: {
            width: '90vw',
            height: '50vh',
            margin: '20px auto',
            backgroundColor: 'green',
            color: 'whitesmoke',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
        }
    }


        return (
            <div>
                <div className="graphs" style={style.graphs} run={pieChartAjax()} >
                    <div className="leftGraph" style={style.leftGraph}>Left Graph</div>
                    <div className="rightGraph" style={style.rightGraph}>Right Graph</div>
                </div>
                <div className="graphInfotron" style={style.infoDiv}>
                    <ul>
                        <li>Stuff stuff stuff stuff, money is cool, right?</li>
                        <li>Trucks and stuff and such and boots and cats and boots and cats</li>
                        <li>Stuff and stuff and such</li>
                    </ul>
                </div>
            </div>
        )
    }


export default Dashboard;
